Id(this.vis.canvasId);\n    \n    \n    Object\n    //Define data\n    \n    this.data = {\n        nodes: nodes,\n        edges: edges\n    };\n    \n    \n    \n    \n    var options = {\n        \n        interaction:{hover:true},\n    \n       nodes: {\n            color: colorHighlight,\n            \n            font: {\n                //color: \"rgb(130,130,130)\",\n                face: \"Roboto, ubuntu, verdana, arial\",\n                size: 14\n            }//,\n           // borderwidth: 20\n        },\n        \n        physics: {\n            enabled: true,\n            //timestep: 0.3,\n            \n            barnesHut: {\n              springConstant: 0.04,\n              damping: 0.09      \n            }\n\n\n        }\n        \n      \n    };\n    var self = this\n    \n    this.network = new Global.vis.Network(container, this.data, options);\n    \n    //Event for clicking on a node\n    this.network.on(\"doubleClick\", function (params) {\n        \n        var idSelectedNode = params.nodes[0];\n        var selectedNode = self.data.nodes.get(idSelectedNode);\n         \n        \n        if (params.nodes.length == 1) {\n        \n                  \n          if (self.network.isCluster(idSelectedNode) == true) { \n              self.network.openCluster(params.nodes[0]);\n          }else if(selectedNode.nodetype==\"category\"){//Cluster\n            var clusterOptionsByData = {\n              joinCondition:  function(childOptions){\n                  \n                  var condition2 = false;\n                  if(childOptions && childOptions.obj && childOptions.obj.category && childOptions.obj.category.toLowerCase){\n                      var condition2 = childOptions.obj.category.toLowerCase() == selectedNode.obj.nameIcon;\n                  }\n                  \n                  \n                  return (childOptions.nodetype === 'project' && condition2) \n                  || childOptions.id == selectedNode.id ;\n              },\n             \n              clusterNodeProperties: {id: selectedNode.id + 'c'  , borderWidth: 3, \n              shape: 'image', image: selectedNode.image , nodetype: \"cluster\" , label: \n              selectedNode.label.replace(\"-\", \"+\"), title: \"Double-click to open\" }\n          };\n          \n             self.network.cluster( clusterOptionsByData);\n            \n          }else{\n             if(selectedNode.obj && selectedNode.obj.nodetype=='project'){\n                self.showProjectOnModal(selectedNode.obj);\n             }\n              \n          }\n        }\n        \n        \n    });\n    \n    \n    this.network.on(\"hoverNode\", function (params) {\n        \n        var nodeId = params.node;\n        var selectedNode = self.data.nodes.get(nodeId);\n      \n     \n      \n      if(self.network.isCluster(nodeId)){\n           //console.log(\"Cluster\");\n            var selectedNode = self.network.findNode(nodeId)[0].options;\n             //console.log(selectedNode);\n        }\n        \n        if(selectedNode && selectedNode.nodetype == 'project'){\n            selectedNode.size = HOVER_SIZE_ICON;\n            self.data.nodes.update(selectedNode);   \n             self.showProjectDescription(selectedNode.obj); \n        }else{\n            self.showNodeTooltip(selectedNode);    \n        }\n        \n       \n        \n        \n        \n    });\n    \n    this.network.on(\"blurNode\", function (params) {\n        \n        var selectedNode = self.data.nodes.get(params.node);\n        self.hideProjectDescription();\n        \n        \n        \n        if(selectedNode && selectedNode.nodetype == 'project'){\n            selectedNode.size = DEF_SIZE_ICON;\n            self.data.nodes.update(selectedNode, true);    \n        }\n        \n        \n        \n        self.hideTooltipInfo(selectedNode);\n    });\n    \n   // self.getFilterButtons2();\n    \n    \n    this.network.fit({\n        nodes: self.network.nodes\n    });\n    \n    \n    \n    \n}","funcProperties":{"__isSmartRef__":true,"id":3442},"__LivelyClassName__":"lively.Closure"},"3441":{"this":{"__isSmartRef__":true,"id":6}},"3442":{"user":"MattH","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Fri Aug 07 2015 11:52:11 GMT-0700 (Pacific Daylight Time)\")"},"3443":{"varMapping":{"__isSmartRef__":true,"id":3444},"source":"function imageType(aType) {\n    \n    //console.log(aType);\n    \n    switch(aType) {\n    case 'pipe':\n        return 'Network-Pipe-icon.png'\n        break;\n    case 'tracker':\n        return 'Network-Pipe-icon.png'\n        break;\n    case 'laptop':\n        return 'Hardware-Laptop-1-icon.png'\n        break;\n    case 'computer':\n        return 'Hardware-My-Computer-3-icon.png'\n        break;\n    case 'client':\n        return 'Hardware-My-Computer-3-icon.png'\n        break;\n    case 'pda':\n        return 'Hardware-My-PDA-02-icon.png'\n        break;\n    case 'printer':\n        return 'Hardware-Printer-Blue-icon.png'\n        break;\n    case 'netdrive':\n        return 'Network-Drive-icon.png'\n        break;\n    case 'firewall':\n        return 'System-Firewall-2-icon.png'\n        break;\n    case 'world':\n        return 'world.png'\n        break;\n    case 'user':\n        return 'user.png'\n        break;\n        \n        \n    case 'games':\n        return 'games.svg';\n    \n    case 'gamesg':\n        return 'gamesGray.svg';\n        \n        \n    case 'productivity':\n        return 'productivity.svg';\n    \n    case 'productivityg':\n        return 'productivityGray.svg';\n        \n        \n    case 'music':\n        return 'music.svg'\n    \n    case 'musicg':\n        return 'musicGray.svg'\n        \n    case 'education':\n        return 'education.svg'\n    \n    case 'educationg':\n        return 'educationGray.svg'    \n        \n    case 'art':\n        return 'graphics.svg';\n    \n    case 'artg':\n        return 'artGray.svg';\n        \n    case 'project':\n        return 'puzzleArt.svg';\n        \n    case 'development':\n        return 'developer_tools.svg';\n    \n    case 'project_art':\n        return 'graphics_project.svg';\n    case 'project_games':\n        return 'games_project.svg';\n    case 'project_music':\n        return 'music_project.svg';\n    case 'project_productivity':\n        return 'productivity_project.svg';\n     case 'project_education':\n        return 'puzzleEducation.svg';\n    case 'project_development':\n        return 'developer_project.svg';\n        \n    case 'projectg':\n        return 'puzzleGray.svg';\n        \n    default:\n        return 'Crystal_128_error.png'\n}\n}","funcProperties":{"__isSmartRef__":true,"id":3445},"__LivelyClassName__":"lively.Closure"},"3444":{"this":{"__isSmartRef__":true,"id":6}},"3445":{"user":"voltaire","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Thu Jul 30 2015 22:47:37 GMT-0700 (Pacific Daylight Time)\")"},"3446":{"varMapping":{"__isSmartRef__":true,"id":3447},"source":"function getData(thenDo) {\n    new Global.URL('http://lively-web.org/nodejs/SessionTracker/sessions/default-flattened').asWebResource().beAsync().get().withJSONWhenDone(function(sessions,status){\n        thenDo({status: status,\n        sessions: sessions\n        })\n        })\n    \n}","funcProperties":{"__isSmartRef__":true,"id":3448},"__LivelyClassName__":"lively.Closure"},"3447":{"this":{"__isSmartRef__":true,"id":6}},"3448":{"user":"MattH","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Wed Jul 15 2015 10:22:46 GMT-0700 (Pacific Daylight Time)\")"},"3449":{"varMapping":{"__isSmartRef__":true,"id":3450},"source":"function addNodes(data) {\n    \n   // console.log(data);\n    \n    //Get rference of the canvas\n    var self = $morph('VisMorphCanvas')\n    \n    //Iterate sessions\n    data.sessions.forEach(function(ea){\n        var id = ea.id\n        var label = 'XXX'\n        var nodetype = 'none'\n        \n        var img = './img/' + self.imageType(ea.type)\n        if (ea.local == true){\n            self.livelyHome = ea.id\n            img = 'http://lively-web.org/core/media/lively-web-logo-small.png'\n            label = 'lively-web.org'\n            nodetype = 'livelyHome'\n        }\n    \n        if (ea.type == 'client'){\n            img = './img/' + self.imageType('world')\n            var temp = ea.worldURL.split('/')\n            label = temp[temp.length-1]\n            nodetype = 'client'\n        }\n        if ((ea.type == 'tracker') && (ea.local != true)){\n            img = './img/' + self.imageType('computer')\n            if (ea.location){\n                label = ea.location.locationString\n            } else {\n                label = 'unknown tracker'\n            }\n            nodetype = 'tracker'\n            \n        }\n        \n        var node = {\n            id: id,\n            label: label,\n            image: img,\n            shape: 'image',\n            sessionInfo: ea,\n            nodetype: nodetype\n        }\n        //show(node)\n        self.data.nodes.update(node)\n        \n    \n        if (ea.type == 'client'){\n            self.data.edges.update({id: ('(' + ea.id + ',' + (ea.user + '_' + ea.trackerId + '_' + ea.location.ip) + ')'),from: ea.id, to: (ea.user + '_' + ea.trackerId + '_' + ea.location.ip), length: 150})\n        }\n        if ((ea.type == 'tracker') && (ea.id != self.livelyHome)){\n            self.data.edges.update({id: ('(' + ea.id + ',' + self.livelyHome + ')'),from: ea.id, to: self.livelyHome,length: 50})\n        }\n        if (ea.user){\n        var Usernode = {\n            id: ea.user + '_' + ea.trackerId + '_' + ea.location.ip,\n            label: ea.user,\n            image: './img/' + self.imageType('user') ,\n            shape: 'image',\n            sessionInfo: ea,\n            nodetype: 'user'\n        }\n        self.data.nodes.update(Usernode)\n        \n        self.data.edges.update({id: ('(' + Usernode.id + ',' + Usernode.sessionInfo.trackerId + ')'),from: Usernode.id, to: Usernode.sessionInfo.trackerId, length: 50})\n        }\n    })\n    self.cleanUp(self.data.nodes,data.sessions)\n    return\n}","funcProperties":{"__isSmartRef__":true,"id":3451},"__LivelyClassName__":"lively.Closure"},"3450":{"this":{"__isSmartRef__":true,"id":6}},"3451":{"user":"voltaire","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Mon Jul 27 2015 14:28:28 GMT-0700 (Pacific Daylight Time)\")"},"3452":{"varMapping":{"__isSmartRef__":true,"id":3453},"source":"function doIt() {\n   // this.getData(this.addNodes)\n}","funcProperties":{"__isSmartRef__":true,"id":3454},"__LivelyClassName__":"lively.Closure"},"3453":{"this":{"__isSmartRef__":true,"id":6}},"3454":{"user":"voltaire","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Tue Jul 21 2015 12:13:08 GMT-0700 (Pacific Daylight Time)\")"},"3455":{"varMapping":{"__isSmartRef__":true,"id":3456},"source":"function cleanUp(nodes,newdata) {\n    var self = this;\n    //Checks for worlds no longer open and removes them\n    nodes.forEach(function(ea){\n        if (ea.nodetype == 'project'){\n            return\n        }\n        /*var result = newdata.filter(function( obj ) {\n            return obj.id == ea.id;\n        });\n        if (result.length == 0){\n            nodes.remove(ea.id)\n        }*/\n        \n    })\n    \n    //Checks for orphaned users and removes them\n    nodes.forEach(function(ea){\n        if (ea.nodetype == 'projects'){\n            if (self.network.getConnectedNodes(ea.id).length \u003c 2){\n                nodes.remove(ea.id)\n            }\n        }\n    })\n}","funcProperties":{"__isSmartRef__":true,"id":3457},"__LivelyClassName__":"lively.Closure"},"3456":{"this":{"__isSmartRef__":true,"id":6}},"3457":{"user":"voltaire","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Tue Jul 21 2015 10:24:39 GMT-0700 (Pacific Daylight Time)\")"},"3458":{"varMapping":{"__isSmartRef__":true,"id":3459},"source":"function getProjectsData() {\n\n    \n\n    function parseCategoryName(str) {\n        return str.split(\"/\")[1];\n    }\n\n    var dataGallery = [];\n    var dataCategory = [];\n    var tmpCat = \"\";\n    var countCat = 0;\n    lively.PartsBin.withAllItemsDo(function (err, items) {\n\n        for (var x in items) {\n            \n\n            tmpCat = parseCategoryName(x);\n            \n            if( ! (tmpCat.toLowerCase()==\"games\" ||\n            tmpCat.toLowerCase()==\"art\" ||\n            tmpCat.toLowerCase()==\"music\" ||\n            tmpCat.toLowerCase()==\"productivity\" ||\n            //tmpCat.toLowerCase()==\"education\" \n            tmpCat.toLowerCase()==\"development\" \n            \n            )){\n              continue;  \n            }\n            \n           \n\n            for (var y in items[x]) {\n           \n            //console.log(items[x][y].getMetaInfo());     \n           \n                try{\n                    var metadata = items[x][y].getMetaInfo();\n                    console.log(metadata);\n           \n                   var creator = metadata.changes[0].author ;\n                   var createdDate = metadata.changes[0].date;\n                   var description = metadata.comment;\n                   var lastModifier = metadata.changes[metadata.changes.length-1].author\n                        \n                        countCat++;\n                        dataGallery.push({\n                            id: items[x][y].name,\n                            projectName: items[x][y].name,\n                            userName: \"\",\n                            value: countCat,\n                            category: parseCategoryName(items[x][y].partsSpaceName),\n                            lastModifiedDate: metadata.lastModifiedDate,\n                            description: description,\n                            createdDate: createdDate,\n                            author: creator,\n                            lastModifier: lastModifier,\n                            nodetype: 'project'\n                        });\n        \n                        //console.log(this[x][y].name);\n                   }catch(e){\n                       console.log(e)\n                   }\n           \n           \n            }\n\n            //dataCategory.push({ name: tmpCat, count: countCat });\n            //countCat = 0;\n        }\n        \n        \n         //End aync\n       // this.addProjectsNodes(\n        //    dataGallery\n      //  );\n        \n        \n    });\n\n   \n    \n    return dataGallery;\n}","funcProperties":{"__isSmartRef__":true,"id":3460},"__LivelyClassName__":"lively.Closure"},"3459":{"this":{"__isSmartRef__":true,"id":6}},"3460":{"user":"voltaire","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Thu Jul 30 2015 23:49:41 GMT-0700 (Pacific Daylight Time)\")"},"3461":{"varMapping":{"__isSmartRef__":true,"id":3462},"source":"function plotProjects() {\n    \n   if (!this.projectsData){\n        this.projectsData = this.getProjectsData();\n   }else{\n  //  this.addProjectsNodes(\n    //    this.projectsData\n    //);\n   }\n    \n    this.addProjectsNodes(\n        this.projectsData\n    );\n    \n    \n    \n    var options = {\n        // position: {x:positionx,y:positiony}, // this is not relevant when focusing on nodes\n        scale: 0.70,\n        //offset: {x:offsetx,y:offsety},\n        //animation: {\n          //duration: duration,\n          //easingFunction: easingFunction\n        //}\n      };\n    \n    \n    this.network.focus(\"rootProjectsGallery\", options);\n}","funcProperties":{"__isSmartRef__":true,"id":3463},"__LivelyClassName__":"lively.Closure"},"3462":{"this":{"__isSmartRef__":true,"id":6}},"3463":{"user":"voltaire","__serializedExpressions__":["timestamp"],"timestamp":"new Date(\"Fri Jul 31 2015 00:04:22 GMT-0700 (Pacific Daylight Time)\")"},"3464":{"varMapping":{"__isSmartRef__":true,"id":3465},"source":"function addProjectsNodes(data) {\n    \n   // console.log(data);\n    \n    //Get rference of the canvas\n    var self = this;\n    var dirBase = \"/users/voltaire/img/new/\";\n    var sizeIconPart = 20;\n    var sizeIconCategory = (sizeIconPart / 2 ) + sizeIconPart;\n    var sizeIconRoot = (sizeIconPart / 4 ) + sizeIconPart\n    \n    data.push({\n         id: \"rootProjectsGallery\",\n         nodetype: 'root'\n    });\n                        \n    data.push({ id: \"catGraph\",\n                nodetype: 'category',\n                nameIcon: 'art',\n                label: 'Graphics & Design'\n             });\n    \n    data.push({ id: \"catProductivity\",\n                nodetype: 'category',\n                nameIcon: 'productivity',\n                label: 'Productivity'\n             });\n    data.push({ id: \"catMusic\",\n                nodetype: 'category',\n                nameIcon: 'music',\n                label: 'Music'\n             });\n    data.push({ id: \"catGames\",\n                nodetype: 'category',\n                nameIcon: 'games',\n                label: 'Games'\n             });\n    /*data.push({ id: \"catEducation\",\n                nodetype: 'category',\n                nameIcon: 'education',\n                label: 'Education'\n             });*/\n    \n    data.push({ id: \"catDevelopment\",\n                nodetype: 'category',\n                nameIcon: 'development',\n                label: 'Development'\n             });\n    \n    \n    //Iterate sessions\n    data.forEach(function(ea){\n        \n        \n        //console.log(JSON.stringify(ea));\n        //return;\n        \n        var id = ea.id;\n        var label = 'XXX';\n        var nodetype = 'none';\n        var img = dirBase + self.imageType(ea.nodetype);\n        var nodeSize = sizeIconPart;\n        var title = \"\";\n        \n        if (ea.nodetype == \"root\"){\n            self.livelyHome = ea.id\n            img = dirBase + \"logoLively.svg\
